(34, 7, 'ka', 0, 'about_us', '', '', '<b style=''font-weight:bold;''>JumpStart</b> Georgia was formed in Tbilisi, Georgia in October, 2009 with the purpose of creating open-source digital maps of Georgia using a network of Community Organizers and volunteers. JumpStart Georgia began with the funding, technical, administrative and financial management support of JumpStart International. JumpStart Georgia has built more than merely maps, however. It has evolved to embody the spirit of open information, improved communication, and increased citizen participation in the world around. We are defined by a set of core values, and we work hard to engage others in what we believe in.', 0, 0),
(55, 8, 'ka', 2, 'submenu1 (ka)', '', 'yes', '<p>man.</p>', -1, -1),
(56, 9, 'en', 0, 'open_information (en)', '', 'Open Information', '<p>We believe that certain information should be accessible by all, particularly non-sensitive data housed by governments and non-governmental organizations. We believe that as much as possible, information should be not only public, so as to spur organic, long-term use, allow for more informed desicion making, and remove barriers to fact-based dialogue, thus diminising the power of violent confrontation and de-politicizing the openness of information.</p>', 0, -1),
(54, 8, 'en', 2, 'submenu1', '', '', '', -1, -1),
(57, 9, 'ka', 0, 'open_information', '', 'Open Information', '<p>We believe that certain information should be accessible by all, particularly non-sensitive data housed by governments and non-governmental organizations. We believe that as much as possible, information should be not only public, so as to spur organic, long-term use, allow for more informed desicion making, and remove barriers to fact-based dialogue, thus diminising the power of violent confrontation and de-politicizing the openness of information.</p>', 0, -1),
(58, 10, 'en', 0, 'participation (en)', '', 'Participation', '<p>We actively encourage participation of target beneficiaries in our projects, therein promoting increased communication between citizens and those who serve them, and increased dialogue among organizations. We believe that tools should be as neutral as possible, as well as inclusive of all segments of society regardless of ethnicity, language, or class. We believe that by utilizing citizen participation alongside clever digital tools we can achieve a menas of information collection that servers as an alternative to traditional methods.</p>', 0, -1),
(59, 10, 'ka', 0, 'participation', '', 'Participation', '<p>We actively encourage participation of target beneficiaries in our projects, therein promoting increased communication between citizens and those who serve them, and increased dialogue among organizations. We believe that tools should be as neutral as possible, as well as inclusive of all segments of society regardless of ethnicity, language, or class. We believe that by utilizing citizen participation alongside clever digital tools we can achieve a menas of information collection that servers as an alternative to traditional methods.</p>', 0, -1),
(60, 11, 'en', 0, 'innovation (en)', '', 'Innovation', '<p>We promote creativity and critical thinking with our partners and project participants. We actively promote new ways of thinking about information, and encourage our partners to look at things differently. We think visually, spatially, and temporally, and we see information in the same way. We believe that creativity and expression that is based on data will lead to amore dynamic society, stronger institutions, and better democracy. JumpStart Georgia''s IT Squad is currently working to develop data management systems while JumpStart Georgia''s program managers have organized several projects in addition to the nationwide mapping initiative.</p>', 0, -1),
