INSERT INTO `news` (`id`, `unique`, `lang`, `show_in_slider`, `title`, `image`, `body`, `published_at`, `category`, `place_unique`) VALUES
(59, 1, 'en', 1, 'Water Supply 2010', 'http://www.pharmamatrixinc.com/assets/images/news.gif', 'In 2010 about 84% of the global population (6.74 billion people) had access to piped water supply through house connections or to an improved water source through other means than house, including standpipes, "water kiosks", protected springs and protected wells. However, about 14% (884 million people) did not have access to an improved water source and had to use unprotected wells or springs, canals, lakes or rivers for their water needs.[1]\r\nA clean water supply, especially so with regard to sewage, is the single most important determinant of public health. Destruction of water supply and/or sewage disposal infrastructure after major catastrophes (earthquakes, f loods, war, etc.) poses the immediate threat of severe epidemics of waterborne diseases, several of which can be life-threatening.', '2011-09-13 14:43', 'text', 70),
(60, 2, 'en', 1, 'Water pollution', 'http://www.newstex.com/wp-content/uploads/2009/01/distributors-news.jpg', 'Water pollution is a major global problem which requires ongoing evaluation and revision of water resource policy at all levels (international down to individual aquifers and wells). It has been suggested that it is the leading worldwide cause of deaths and diseases,[1][2] and that it accounts for the deaths of more than 14,000 people daily.[2] An estimated 700 million Indians have no access to a proper toilet, and 1,000 Indian children die of diarrheal sickness every day.[3] Some 90% of China''s cities suffer from some degree of water pollution,[4] and nearly 500 million people lack access to safe drinking water.[5] In addition to the acute problems of water pollution in developing countries, industrialized countries continue to struggle with pollution problems as well. In the most recent national report on water quality in the United States, 45 percent of assessed stream miles, 47 percent of assessed lake acres, and 32 percent of assessed bay and estuarine square miles were classified as polluted.[6]\r\nWater is typically referred to as polluted when it is impaired by anthropogenic contaminants and either does not support a human use, such as drinking water, and/or undergoes a marked shift in its ability to support its constituent biotic communities, such as fish. Natural phenomena such as volcanoes, algae blooms, storms, and earthquakes also cause major changes in water quality and the ecological status of water.', '2011-09-13 14:47', 'text', 71),
(61, 3, 'en', 1, 'world and water', 'uploads/277vw1.jpg', 'Water is a chemical substance with the chemical formula H2O. Its molecule contains one oxygen and two hydrogen atoms connected by covalent bonds. Water is a liquid at ambient conditions, but it often co-exists on Earth with its solid state, ice, and gaseous state (water vapor or steam). Water also exists in a liquid crystal state near hydrophilic surfaces.[1][2]\r\nWater covers 70.9% of the Earth''s surface,[3] and is vital for all known forms of life.[4] On Earth, it is found mostly in oceans and other large water bodies, with 1.6% of water below ground in aquifers and 0.001% in the air as vapor, clouds (formed of solid and liquid water particles suspended in air), and precipitation.[5] Oceans hold 97% of surface water, glaciers and polar ice caps 2.4%, and other land surface water such as rivers, lakes and ponds 0.6%. A very small amount of the Earth''s water is contained within biological bodies and manufactured products.\r\nWater on Earth moves continually through a cycle of evaporation or transpiration (evapotranspiration), precipitation, and runoff, usually reaching the sea. Over land, evaporation and transpiration contribute to the precipitation over land.', '2011-09-13 15:46', 'photo', 64),
(62, 1, 'ka', 1, 'Water Supply 2010', 'uploads/567open-taps-logo.gif', '<p>In 2010 about 84% of the global population (6.74 billion people) had access to piped water supply through house connections or to an improved water source through other means than house, including standpipes, "water kiosks", protected springs and protected wells. However, about 14% (884 million people) did not have access to an improved water source and had to use unprotected wells or springs, canals, lakes or rivers for their water needs.[1] A clean water supply, especially so with regard to sewage, is the single most important determinant of public health. Destruction of water supply and/or sewage disposal infrastructure after major catastrophes (earthquakes, f loods, war, etc.) poses the immediate threat of severe epidemics of waterborne diseases, several of which can be life-threatening.</p>', '2011-09-13 14:43', 'text', -1),
(63, 2, 'ka', 1, 'Water pollution', 'http://www.newstex.com/wp-content/uploads/2009/01/distributors-news.jpg', 'Water pollution is a major global problem which requires ongoing evaluation and revision of water resource policy at all levels (international down to individual aquifers and wells). It has been suggested that it is the leading worldwide cause of deaths and diseases,[1][2] and that it accounts for the deaths of more than 14,000 people daily.[2] An estimated 700 million Indians have no access to a proper toilet, and 1,000 Indian children die of diarrheal sickness every day.[3] Some 90% of China''s cities suffer from some degree of water pollution,[4] and nearly 500 million people lack access to safe drinking water.[5] In addition to the acute problems of water pollution in developing countries, industrialized countries continue to struggle with pollution problems as well. In the most recent national report on water quality in the United States, 45 percent of assessed stream miles, 47 percent of assessed lake acres, and 32 percent of assessed bay and estuarine square miles were classified as polluted.[6]\r\nWater is typically referred to as polluted when it is impaired by anthropogenic contaminants and either does not support a human use, such as drinking water, and/or undergoes a marked shift in its ability to support its constituent biotic communities, such as fish. Natural phenomena such as volcanoes, algae blooms, storms, and earthquakes also cause major changes in water quality and the ecological status of water.', '2011-09-13 14:47', 'text', 71),
(64, 3, 'ka', 1, 'world and water', 'uploads/277vw1.jpg', '<p>Water is a chemical substance with the chemical formula H2O. Its molecule contains one oxygen and two hydrogen atoms connected by covalent bonds. Water is a liquid at ambient conditions, but it often co-exists on Earth with its solid state, ice, and gaseous state (water vapor or steam). Water also exists in a liquid crystal state near hydrophilic surfaces.[1][2] Water covers 70.9% of the Earth''s surface,[3] and is vital for all known forms of life.[4] On Earth, it is found mostly in oceans and other large water bodies, with 1.6% of water below ground in aquifers and 0.001% in the air as vapor, clouds (formed of solid and liquid water particles suspended in air), and precipitation.[5] Oceans hold 97% of surface water, glaciers and polar ice caps 2.4%, and other land surface water such as rivers, lakes and ponds 0.6%. A very small amount of the Earth''s water is contained within biological bodies and manufactured products. Water on Earth moves continually through a cycle of evaporation or transpiration (evapotranspiration), precipitation, and runoff, usually reaching the sea. Over land, evaporation and transpiration contribute to the precipitation over land.</p>', '2011-09-13 15:46', 'photo', 64),
